import React from 'react';
import './App.css';
import {Routes , Route} from 'react-router-dom';

let App= ()=> {
  return (
    <React.Fragment>
      <NavBar>
        <Routes>
          <Route path={'/'}/>
          <Route path={'/contacts/list'}/>
        </Routes>


      </NavBar>

    </React.Fragment>
  );
}

export default App;
